// Main.js
import React from 'react';
import { Link } from 'react-router-dom';

function Main() {
    return (
        <div className="container">
            <h2>Welcome to the Banking System</h2>
            <nav>
                <ul>
                    <li><Link to="/add-balance">Add Balance</Link></li>
                    <li><Link to="/check-balance">Check Balance</Link></li>
                    <li><Link to="/deduct-balance">Deduct Balance</Link></li>
                    <li><Link to="/credit-increase">Credit Card Increase</Link></li>
                    <li><Link to="/approval-check">Credit Card Approval Check</Link></li>
                    <li><Link to="/loan-approval">Loan Approval</Link></li>
                    <li><Link to="/product-exploration">Product Exploration</Link></li>
                    <li><Link to="/add-user">Add User Profile</Link></li>
                    <li><Link to="/delete-user">Delete User Profile</Link></li>
                    <li><Link to="/update-user">Update User Profile</Link></li>
                </ul>
            </nav>
        </div>
    );
}

export default Main;
